export default function Quran() {
  return (
    <Container>
      <Row>
        <Col>
          {" "}
          <FloatingLabel
            controlId="floatingInput"
            label="Email address"
            className="mb-3"
          >
            <Form.Control type="email" placeholder="name@example.com" />
          </FloatingLabel>
        </Col>
        <Col></Col>
      </Row>


    </Container>
  );
}
